import './App.css';

function App() {
  return (
	<div>
		<header>
			<h1><a href="/">WEB</a></h1>
		</header>
		<nav>
			<ol>
				<li><a href="/read/1">html</a></li>
				<li><a href="/read/2">html</a></li>
				<li><a href="/read/3">html</a></li>
			</ol>
		</nav>
		<article>
			<h2>Welcome</h2>
			Hello, WEB
		</article>
	</div>
  );
}

export default App;
